text878750.addInnerText('<div id=\"text878750\"><a id=\"text878750anc\" tabindex=\"55\"style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.352\" style=\"margin-left:0px;text-indent:0px;line-height:1.296;margin-top:0px;margin-bottom:3px;text-align:left;\" >\n<span class=\"text878750Font1\" style=\"position:relative;top:-1px;\" >Project Need\n</span ></p >\n<p  legLH=\"1.352\" style=\"margin-left:0px;text-indent:0px;line-height:1.296;margin-top:0px;margin-bottom:3px;text-align:left;\" >\n<span class=\"text878750Font2\" style=\"position:relative;top:-1px;\" >To create an improved shroud for DePuy Synthes internal foundries where metal castings are produced. In these foundries, shrouds are used with argon to help reduce metal alloy oxidation while transferring the molten metal from the crucible into the molds. The original shroud used high amounts of argon in liquid form and resulted in molten metal splatter. A new optimized shroud was needed to use less argon and improve safety with less or no molten metal splatter. </span ><span class=\"text878750Font3\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n</span ></p >\n</div>\n');
